import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const TribunaisListPageUser = () => {
  const [tribunais, setTribunais] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    listarTribunais();
  }, []);

  const listarTribunais = async () => {
    try {
      const res = await axios.get('http://localhost:3001/tribunais');
      const tribunaisWithRatings = await Promise.all(
        res.data.map(async (tribunal) => {
          try {
            const ratingRes = await axios.get(`http://localhost:3001/tribunais_avaliacao/${tribunal.id_tribunal}`);
            return {
              ...tribunal,
              avaliacao_media: parseFloat(ratingRes.data.media_avaliacao) || 0,
            };
          } catch (err) {
            return {
              ...tribunal,
              avaliacao_media: 0,
            };
          }
        })
      );
      setTribunais(tribunaisWithRatings);
    } catch (err) {
      console.error('Erro ao listar tribunais:', err);
    }
  };

  const getImagemUrl = (imagem) => {
    if (!imagem) return null;
    if (imagem.startsWith('/uploads/tribunais/')) {
      return `http://localhost:3001${imagem}`;
    }
    return `http://localhost:3001/uploads/tribunais/${imagem}`;
  };

  const handleVisualizarClick = (id_tribunal) => {
    localStorage.setItem('id_tribunal', id_tribunal);
  };

  const filteredTribunais = tribunais.filter(tribunal => 
    tribunal.nome.toLowerCase().includes(searchTerm.toLowerCase()) || 
    tribunal.endereco.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const formatRating = (rating) => {
    const numRating = parseFloat(rating);
    return isNaN(numRating) ? "0.0" : numRating.toFixed(1);
  };

  return (
    <div className="bg-gray-100 min-h-screen p-4">
      {/* Barra de Pesquisa */}
      <div className="bg-white p-4 rounded-lg shadow-sm mb-4">
        <input
          type="text"
          placeholder="Pesquisar tribunais..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="w-full p-2 rounded-full bg-gray-100 border-0"
        />
      </div>

      {/* Categorias */}
      <div className="bg-white p-4 mb-4 rounded-lg shadow-sm overflow-x-auto">
        <div className="flex space-x-4">
          <button className="px-4 py-2 text-green-600 border-b-2 border-green-600">Todos</button>
          <button className="px-4 py-2 text-gray-600">Mais Avaliados</button>
          <button className="px-4 py-2 text-gray-600">Melhor Classificação</button>
        </div>
      </div>

      {/* Lista de Tribunais */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {filteredTribunais.map(tribunal => (
          <Link
            key={tribunal.id_tribunal}
            to={`/user/dashboard/tribunais/${tribunal.id_tribunal}/feedback`}
            onClick={() => handleVisualizarClick(tribunal.id_tribunal)}
            className="block bg-white rounded-lg p-4 hover:shadow-md transition-shadow"
          >
            <div className="flex">
              {/* Imagem */}
              <div className="w-20 h-20 rounded-lg overflow-hidden bg-gray-100 flex-shrink-0">
                {tribunal.imagem ? (
                  <img
                    src={getImagemUrl(tribunal.imagem)}
                    alt={tribunal.nome}
                    className="w-full h-full object-cover"
                  />
                ) : (
                  <div className="w-full h-full flex items-center justify-center text-gray-400">
                    Sem imagem
                  </div>
                )}
              </div>

              {/* Informações */}
              <div className="ml-4 flex-grow">
                <h3 className="font-medium text-gray-900">{tribunal.nome}</h3>
                <p className="text-sm text-gray-500 mt-1">{tribunal.cidade}</p>
                <div className="mt-1">
                  <span className="text-sm bg-green-100 text-green-800 px-2 py-1 rounded">
                    ★ {formatRating(tribunal.avaliacao_media)}
                  </span>
                </div>
                <p className="text-xs text-gray-500 mt-2">
                  {tribunal.endereco}
                </p>
              </div>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default TribunaisListPageUser;
